  const initialURL = "https://api.pexels.com/v1/curated?page=1&per_page=15";
  const search = async () => {
    const dataFetch = await fetch(initialURL, {
      method: "GET",
      headers: {
        accept: "application/json",
        Authorization: auth,
      },
    });
    let parseData = await dataFetch.json();
    setData(parseData.photos);
